import React from "react";
import "./TutSite.css";
import Anleitungen from "./Anleitungen";

var runner = 4;
for (let i = 0; i < runner; ++i) {
  console.log("for_" + i);
}

while (runner > 1) {
  runner = runner / 2;
  console.log("while_" + runner);
}

// do {
//   runner = runner / 2;
//   console.log("do_while" + runner);
// } while (runner > 1);

function TutSite(props) {
  return (
    <div className="section">
      <a ref={props.tutRef} style={{ color: "white" }}>
        Pinnacle Sports, AsianConnect
      </a>
      <div classname="section__wrapper">
        <div className="section__header">
          <a className="section__header__text" style={{ paddingTop: "3%" }}>
            Anleitungen
          </a>
        </div>

        <div className="section_items">
          <Anleitungen />
        </div>
      </div>
    </div>
  );
}

export default TutSite;
